const styles = (theme) => ({
  hideContent: {
    display: 'none',
  },
  textarea: {
    backgroundColor: 'white',
  },
  datepicker: {
    backgroundColor: 'white',
  },
  checkboxGroup: {
    marginTop: '0 !important',
    paddingBottom: '0 !important',
  },
  radioGroup: {
    display: 'flex',
    flexDirection: 'column',
  },
  errorMessage: {
    fontSize: theme.typography.pxToRem(10),
    color: theme.palette.error.main,
  },
});

export default styles;
